INSERT INTO `cmswing_attribute` VALUES ('138', 'fare', '运费模板', 'int(10) unsigned NOT NULL', 'relation', '', '1、如果店铺只使用一种运费模板规则，那么顾客下单计算时均按此规则收取运费。<br>\r\n 2、如果店铺使用了不同的运费模板规则，那么顾客下单时各运费模板规则先单独计算运费再叠加。<br>\r\n3、如果不选则使用同一默认的运费模板规则', '1', 'model:fare\r\nid:id\r\nval:name', '4', '0', '1', '0', '1498029163086', '', '3', '', 'regex', '', '3', 'function');
INSERT INTO `cmswing_author` VALUES ('3', '王西京', '129', '1', '9', '1486376457310', '1486457950606', '1', '17', 'wangxijing', '787', '130', '0', '0.00', '', '');
INSERT INTO `cmswing_author` VALUES ('4', '杨晓阳', '129', '2', '9', '1486441452470', '1486448574498', '1', '17', 'yangxiaoyang', '788', '125', '0', '0.00', '', '');
INSERT INTO `cmswing_author` VALUES ('5', '李壮平', '129', '3', '9', '1486456983148', '1486630400369', '1', '17', 'lizhuangping', '789', '213', '0', '10000.00', '李壮平，出生于1948年，目前是画院院长，艺术院校教授，潜心数十年，对国画和油画有深入研究，画画是他钟爱一生的事业。他想把自己的女儿也培养成一名画家。2008年，在经得李勤同意后，李壮平以女儿李勤做为女神的原型，和已经是青年画家的女儿李勤共同出油画册《中国写实派油画家李壮平 李勤东方神女山鬼系列油画作品集》。李壮平目前是中国用写实油画表现屈原的“山鬼”（人与自然，美女与野兽）第一人，作品深受海内外', );
INSERT INTO `cmswing_author` VALUES ('6', '刘文西', '129', '4', '9', '1486483214047', '1486483214048', '1', '17', 'liuwenxi', '790', '127', '0', '0.00', '', '');
INSERT INTO `cmswing_author` VALUES ('7', '郭全忠', '129', '1', '9', '1486483483674', '1486483483675', '1', '17', 'guoquanzhong', '791', '106', '0', '0.00', '', '');
INSERT INTO `cmswing_author` VALUES ('8', '罗平安', '129', '0', '9', '1486542017230', '1486546089772', '1', '17', 'luopingan', '792', '178', '0', '3000.00', '罗平安，中共党员，画家。湖北黄陂人，1945年4月生于陕西西安，擅长中国画。1966年毕业于西安美术学院中专部，后师从方济众先生。 1981年任陕西国画院创研室副主任，陕西省美术家协会书记处书记。兼任陕西省榆林地区文化局副局长。现为中国美术家协会会员，西安美术学院客座教授，陕西省美术家协会常务理事、艺术委员会委员，国家一级美术师，陕西国画院画师，国务院授予的“突出贡献专家”。 作品有《雪霁》、《樊', );
INSERT INTO `cmswing_author` VALUES ('9', '姜怡翔', '129', '0', '9', '1486543740410', '1486545503178', '1', '17', 'jiangyixiang', '793', '122', '0', '10000.00', '姜怡翔1962年生，山东海阳人。1981年考入西安美术学院，1985年毕业并留校任教。现任西安美院副院长、国画系花鸟工作室主任、教授、硕士生导师、博士生导师、省级教学名师。中国美术家协会会员、陕西省美术家协会理事、陕西省花鸟画研究会副会长。', );
