INSERT INTO `cmswing_document_download` VALUES ('120', '0', '<p><span style=\"font-family: tahoma, Arial, 宋体, 微软雅黑; font-size: 12px; line-height: 22px; background-color: rgb(255, 255, 255);\">玩游戏必备的语音软件，玩公会，与战友来论战。多玩网旗下的一款永久免费的团队语音软件，支持超大的万人群，彻底解决公会组织难题；实现游戏内自动队伍语音，公会一键收人，快速跳转房间等便捷功能，支持目前大部分主流游戏，带给您轻巧，高效，掌控自如的游戏语音体验。除此之外，歪歪还为玩家永久线上保存聊天记录，随时随地翻查。</span></p>', '', '39', '4', '226939', '846', '');
