INSERT INTO `cmswing_document_download` VALUES ('122', '0', '<p><span style=\"font-family: tahoma, Arial, 宋体, 微软雅黑; font-size: 12px; line-height: 22px; background-color: rgb(255, 255, 255);\">侠盗猎车手（Grand Theft Auto) 为一系列游戏，也译作：侠盗猎车、侠盗飞车、侠盗车手、横行霸道等。简称为GTA。</span></p>', '', '41', '3', '226939', '', '');
INSERT INTO `cmswing_document_download` VALUES ('123', '0', '<p><span style=\"font-family: tahoma, Arial, 宋体, 微软雅黑; font-size: 12px; line-height: 22px; background-color: rgb(255, 255, 255);\">Minecraft[1]是一个沙盘建造游戏，中文非官方译名为《我的世界》，《当个创世神》或 《麦块》。这个游戏让每一个玩家在三维空间中自由地创造和破坏不同种类的方块。其灵感源自于无尽矿工，矮人要塞和地城守护者。创始人为马库斯·阿列克谢·泊松，他同时也是Mojang AB的创立人。目前的开发负责人为延斯·伯根斯坦。玩家在游戏中的形象可以在单人或多人模式中通过摧毁或创造方块以创造精妙绝伦的建筑物，创造物和艺术品。</span></p>', '', '42', '3', '226939', '', '');
