INSERT INTO `cmswing_document_download` VALUES ('142', '0', '<p><span style=\"font-family: tahoma, Arial, 宋体, 微软雅黑; font-size: 12px; line-height: 22px; background-color: rgb(255, 255, 255);\">搜狗输入法作为国内汉字拼音输入法的领导者，搜狗输入法率先实现了输入法与互联网的结合。基于搜狗搜索引擎技术，对中文词库有突破性发展，开创了新一代中文输入法。即时高效地更新热门词库，大幅提升了输入效率，让输入速度产生了质的飞跃。在词库的广度、词语的准确度上，搜狗输入法都在行业内遥遥领先。 创新进取，为用户不断创造价值，是我们一直秉承的理念。多年以来，搜狗输入法不断突破自己，独家开创的细胞词库功能实现了开放共享、细分化词库的功能，通过选取合适的细胞词库，搜狗可以覆盖几乎所有的中文词汇。除此之外，行业内首创人名模式、云输入、纠错、长词联想、符号表情等诸多实用功能，方便了数以亿计用户的输入。 有中文输入的地方，就有搜狗输入法。享受输入，享受搜狗。</span></p>', '', '61', '3', '226939', '', '');
