INSERT INTO `cmswing_document_download` VALUES ('151', '0', '<p><span style=\"font-family: tahoma, Arial, 宋体, 微软雅黑; font-size: 12px; line-height: 22px; background-color: rgb(255, 255, 255);\">免费的PDF文档阅读器和打印器。英文名为Foxit Reader，拥有小巧的体积、快捷的启动速度和丰富的功能，其核心技术与PDF标准版1.7完全兼容。其独有的批注工具，在您阅读PDF文档时完全可以在文档上画图、高亮文本、输入文字，并且对批注的文档进行打印或保存。注意：PDF导出TXT文档功能属于高级应用，需要专业版版本才能实现，宝库提供的免费版本并不支持。</span></p>', '', '70', '1', '226939', '', '');
