INSERT INTO `cmswing_document_download` VALUES ('159', '0', '<p><span style=\"font-family: tahoma, Arial, 宋体, 微软雅黑; font-size: 12px; line-height: 22px; background-color: rgb(255, 255, 255);\">小熊壁纸收集大量的优美漂亮图片，精选海量高清桌面壁纸，为用户打造超炫超多的壁纸应用。小熊壁纸拥有热门壁纸搜索、精选分类导航、颜色筛选、自动切换壁纸、个性化搜索等多项功能，个性你的电脑——从小熊壁纸开始！</span></p>', '', '78', '3', '226939', '', '');
INSERT INTO `cmswing_document_download` VALUES ('160', '0', '<p><span style=\"font-family: tahoma, Arial, 宋体, 微软雅黑; font-size: 12px; line-height: 22px; background-color: rgb(255, 255, 255);\">UltraEdit 是一套功能强大的代码编辑器，可以编辑文本、十六进制、ASCII 码，可以取代记事本，内建英文单字检查、C++ 及 VB 指令突显，可同时编辑多个文件，而且即使开启很大的文件速度也不会慢。软件附有 HTML 标签颜色显示、搜寻替换以及无限制的还原功能，一般大家喜欢用其来修改EXE 或 DLL 文件。烈火完美汉化版，内含注册机！</span></p>', '', '79', '2', '226939', '', '');
INSERT INTO `cmswing_document_download` VALUES ('161', '0', '<p><span style=\"font-family: tahoma, Arial, 宋体, 微软雅黑; font-size: 12px; line-height: 22px; background-color: rgb(255, 255, 255);\">免费的文件管理客户端。可以跨时间段的管理文件和目录。文件保存在中央版本库，除了能记住文件和目录的每次修改以外，版本库非常像普通的文件服务器。你可以将文件恢复到过去的版本，并且可以通过检查历史知道数据是谁做了哪些修改。</span></p>', '', '80', '2', '226939', '', '');
INSERT INTO `cmswing_document_download` VALUES ('162', '0', '<p><span style=\"font-family: tahoma, Arial, 宋体, 微软雅黑; font-size: 12px; line-height: 22px; background-color: rgb(255, 255, 255);\">集合多版本IE浏览器，专供网页兼容性测试的工具。它包含了5个版本的IE（5.5/6.0/7.0/8.0/9.0 Preview），以分页标签的方式，在不同的标签中显示你指定的浏览器版本的网页浏览画面，完全可以满足对IE兼容性的测试，堪称网站前端开发人员的必备工具。安装过程中会有多国语言选择提示，勾选“Simplified Chinese（简体中文）”项即可。</span></p>', '', '81', '3', '226939', '', '');
INSERT INTO `cmswing_document_download` VALUES ('163', '0', '<p>一个免费的Dock程序，不过由于它的界面和通常你想象的不一样，也可以把它看作快速启动面板或者是快速启动菜单。Appetizer拥有人性化的界面和设置，使用向导模式可以批量导入软件的快捷方式；可以把各类程序分类；还带有快捷键设置功能。• 支持插件 • 支持多种皮肤（内置的已经包括两个） • 可调整 Dock 大小，自由排列图标 • 三种图标显示尺寸：小型，大型和特大型 • 支持自定义图标 • Wizard 向导可以自动导入各类应用 • 支持图标的拖曳摆放 • 支持 Multi-launch 多重启动 • 在一个菜单中重组多个应用快捷方式</p>', '', '82', '1', '226939', '', '');
INSERT INTO `cmswing_document_download` VALUES ('164', '0', '<p><span style=\"font-family: tahoma, Arial, 宋体, 微软雅黑; font-size: 12px; line-height: 22px; background-color: rgb(255, 255, 255);\">Google推出的一款卫星地图工具。整合Google的本地搜索以及驾车指南两项服务，能够鸟瞰世界，他可以在虚拟世界中如同一只雄鹰在大峡谷中自由飞翔，登陆峡谷顶峰，潜入峡谷深渊，最新版本还加入了海洋探索。 提示：如无法打开，配置hosts：203.208.46.30 kh.google.com尝试。</span></p>', '', '83', '1', '226939', '', '');
INSERT INTO `cmswing_document_download` VALUES ('165', '0', '<p><span style=\"font-family: tahoma, Arial, 宋体, 微软雅黑; font-size: 12px; line-height: 22px; background-color: rgb(255, 255, 255);\">福星电脑闹钟是一款具有定时提醒、定时关机、定时打开程序、定时关闭程序的软件，同时还具有定时休眠、定时注销、定时锁定、定时宽带连接、定时断开宽带连接等功能于一身的软件，功能强大。定时提醒功能可选择一次提醒、每周提醒、每月提醒、每年提醒、开机提醒、周期提醒等多种提醒功能。 同时福星闹钟还可以根据设定鼠标键盘无操作时自动待机、自动锁定、关机等操作，提供了百度对时中心进行网络对时。 福星电脑闹钟占用极少的内存，软件最小化后仅占用1M多的内存，速度飞快，是同类软件中的佼佼者。福星闹钟官网：http://www.fuxingnz.com/ 更新日志： v2.2.0 Build 2013-12-25 优化程序内部一些函数逻辑； 增加了运行程序功能，和“打开程序、文件或网址”的区别是运行程序可以带参数运行； 增加了鼠标键盘无操作时全屏不执行； 托盘图标增加显示当前日期、星期、农历功能，优化了托盘双击和单击，弹出界面灵活； 修复了WIN7下宽带连接跳出窗口不能自动连接的问题； 修复WIN7和XP系统下列表框显示高度不一致的问题； 每周闹钟增加了星期选择，每周闹钟设置更灵活（老版本升级的需要重新设置每周闹钟）； 优化了关闭程序功能，关闭程序更彻底； 优化了打开程序或网址，可打开YY飞机票和QQ临时会话等； 优化了闹钟提示窗口和过期提醒。 福星电脑闹钟正式启用新域名：http://www.fuxingnz.com/</span></p>', '', '84', '3', '226939', '', '');
